    R, C = map(int, stdin.strip().split())
    R, C = R - 1, C - 1
    table = stdin.strip()
    table = table.replace("#", "#..#").replace("X", ".X#.").replace(".", "#.X.")

    def dfs(r, c, visited, group):
        if not 0 <= r < R or not 0 <= c < C:
            return
        if table[r][c] == "#":
            return
        if table[r][c] == "." and visited[r][c]:
            group += 1
            visited[r][c] = True
            dfs(r, c + 1, visited, group)
            dfs(r + 1, c, visited, group)
            dfs(r - 1, c, visited, group)
            dfs(r, c - 1, visited, group)
        else:
            group += 1

    groups = []
    visited = [[False for _ in range(C)] for _ in range(R)]
    for r in range(R):
        for c in range(C):
            if not visited[r][c]:
                group = 0
                dfs(r, c, visited, group)
                groups.append(group)

    print(len(groups))
    for group in groups:
        print(group, end=" ")

